Core:PCProperties.Core:Property:
         X[M] string output;
output = "";

\$az = \$\{Chatters:AE:az:azrael\};

\$folder = "Chatters:IC";

/* run script in each character */
EmitTo(\$az, "Running skill update script");
\$folders = Call(\$\{/usr/System/sys/idd\}, "idd:get-folders");

\$cont = TRUE;
/*\$cont = FALSE;*/

for(\$i=0;\$i\<sizeof(\$folders);\$i++) \{
  object char;
  \$delay(0.01, TRUE, "31b8");
  \$folder = "Chatters:IC:"+\$folders[\$i];
  \$characters = Call(\$\{/usr/System/sys/idd\}, "idd:get-objects");
  for(\$j=0;\$j\<sizeof(\$characters);\$j++) \{
    char = Obj("Chatters:IC:"+\$folders[\$i]+":"+\$characters[\$j]);
    EmitTo(\$az, dump_value(char));
    \$careers = map_indices(prefixed_map(char."*", "skill:career:"));
    for(\$k=0;\$k\<sizeof(\$careers);\$k++) \{
      \$arr = Arr(Get(this, \$careers[\$k]));
      \$arr \|= (\{ char \});
      Set(this, \$careers[\$k], \$arr);
    \}
  \}

\}
EmitTo(\$az, "Script finished");

         X[M] string output;
output = "";

\$az = \$\{Chatters:AE:az:azrael\};

if(!\$career) \{
  EmitTo(\$az, "No \$career variable passed.");
  return TRUE;
\}

\$career = "skill:career:"+Str(\$career);
\$list = Arr(Get(this, \$career));
\$list -= (\{ nil \});

/* sort the list */
EmitTo(\$az, "Sorting");
for(\$i=1;\$i\0) \{
    if(Get(\$list[\$i], \$career) \> Get(\$list[\$i-1], \$career)) \{
      \$tmp = \$list[\$i];
      \$list[\$i] = \$list[\$i-1];
      \$list[\$i-1] = \$tmp;
      \$i = \$i-2;
    \}
  \}
\}
Set(this, \$career, \$list);
EmitTo(\$az, "Sorted");

for(\$i=0;\$i\ time() \&\& Get(\$list[\$i], \$career) \>= 6)
    EmitTo(\$az, output);
\}

/* list output */

EmitTo(\$az, "Script finished");
